const MasterEmailEnter = ({email, setEmail, codeConf, setCodeConf, code, setCode}) => {

    const sendNewCode = () => {
        setCodeConf(false);
    }
    
    return(<div className="phaseBlock">
        <input placeholder="почта" value={email} onChange={e => setEmail(e.target.value)}></input>
        {codeConf?
        <div>
            <button onClick={sendNewCode}>выслать код</button>
        </div>
        :
        <div>
            <input placeholder="код" onChange={e => setCode(e.target.value)}></input>
        </div>}
    </div>);
};

export default MasterEmailEnter;
